static listaNomePorCodigo(codigoParam){jQuery(document).ready(function(){jQuery.ajax({type:'GET',contentType:'application/json',dataType:"json",url:'http://localhost/sistemaRest/api/v1/time/index.php?a=1&id='+codigoParam,success:function(data){document.getElementById("txtNome").value=data.nomeTime},error:function(jqXHR,textStatus,errorThrown){document.getElementById("txtNome").innerHTML="Falha ao carregar nome!"}})})}
static carregaDivisao(codigo){jQuery(document).ready(function(){jQuery.getJSON("http://localhost/sistemaRest/api/v1/divisao/index.php?a=1&id="+codigo,function(json){var len=json.divisaos.length;var temRegistro=!1;var strHTML='';for(var i=0;i<len;i++){var codigo=json.divisaos[i].codigo;var nome=json.divisaos[i].nome;if(json.divisaos[i].selected){strHTML=strHTML+"<option selected=\"true\" value=\""+codigo+"\">"+nome+"</option>"}else{strHTML=strHTML+"<option value=\""+codigo+"\">"+nome+"</option>"}
temRegistro=!0}
if(temRegistro==!1){strHTML="<option value=\"\">Nenhuma categoria cadastrada</option>"}
document.getElementById("cmbDivisao").innerHTML=strHTML})})}
